import { Box, Button } from "@chakra-ui/react";

function AdminPage() {
  return (
    <Box h="100vh" w="100%" background="gray.100">
      <Button
        pos="absolute"
        top={30}
        right={30}
        padding="25px 20px"
        backgroundColor="teal"
        color="white"
        _hover={{ bg: "teal.200" }}
      >
        Создать ответ
      </Button>
      <Box></Box>
    </Box>
  );
}

export default AdminPage;
